import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function App() {
  const [x, setX] = useState(5);
  function clik(){
    setX(x+5);
  }
  return (
    <div className="App">
      {x}
      <button id="hi" onClick={clik}>click</button>
    </div>
  );
}

export default App;
